import React from "react";

function Header() {
  return (
    <header>
      <nav
        className="w-full active transparent flex flex-row 
                      justify-between px-20 items-center"
      >
        <div className="logo flex flex-row justify-center space-x-5 items-center">
          <img src="" alt="Logo" />
          <p className="">SuGa</p>
        </div>
        <button className="nav-button">Log in</button>
      </nav>
    </header>
  );
}
export default Header;
